css:
@-moz-document domain("stage.transferroom.com"), domain("prod.transferroom.com"), domain("dev.transferroom.com"), domain("devx.transferroom.com"), domain("transferroom.com") {
body { background: #f6f6f7; }
.tr-advanced-filter {
    background: transparent;
}

.tr-navbar {
    background: transparent;
    box-shadow: none;
}

.tr-navbar:before {
    content: '';
    background-color: #fff;
    box-shadow: 0 4px 2px -2px rgba(0,0,0,.1);
    display: block;
    position: absolute;
    width: 100vw;
    height: 100%;
    z-index: -1;
    left: 50%;
    transform: translate(-50%,0);
}

.tr-advanced-filter__header.tr-advanced-filter__header--clicable .align-middle {
    font-weight: 500;
}

.tr-advanced-filter__header {
    border-top: 1px solid #d4d4d4;
}

.tr-checkbox:hover input[type=checkbox]+i:before {
   opacity:.3;
}

.tr-advanced-filter .tr-btn--transparent {
    background: #f6f6f7;
    border: none;
    color: #09335f;
    opacity: .9;
    box-shadow: 0 1px 3px rgba(0,0,0,.15);
}
.tr-checkbox--stacked input[type=checkbox]~i {
    flex-shrink: 0;
} 

.tr-checkbox {
      align-items: flex-start;
}

.tr-checkbox--stacked input[type=checkbox]:checked~i {
    background-color: #1467bf !important;
}  
  
.tr-advanced-filter__section,
.tr-advanced-filter__header {
    color: inherit;
}

.tr-advanced-filter__clear-button {
    color: inherit; opacity: .3;
}

.tr-advanced-filter__clear-button:hover {
    opacity: 1;
}

.tr-advanced-filter__section-icon {
    color: #213151;
}

.tr-advanced-filter__body .tr-checkbox {
    margin-bottom: 10px;
}

.input-range {
    margin: 0 5px;
    width: calc(100% - 10px);
}

.input-range__slider {
    background: #f6f6f7;
    border: 3px solid #1467bf;
}

.input-range__track--active {
    background: #1467bf;
}

.tr-range-selector__status {
    color: inherit;
}

.custom-radiobutton--primary .custom-radiobutton--checked {
    background: #1467bf;
    background-clip: content-box;
}

.tr-checkbox input[type=checkbox]~i:before {
    font-size: 10px;
}

.tr-checkbox input[type=checkbox]~i {
    border: solid 1px #d2dce8;
}

.tr-advanced-filter__body .tr-checkbox input[type=checkbox]:checked~i {
    background: #1467bf;
    border-color: #1467bf;
}

.tr-checkbox--stacked input[type=checkbox]:checked~i+i, .tr-checkbox--stacked input[type=checkbox]~i, .tr-checkbox--stacked input[type=checkbox]~i+i {
    background-color: #f6f6f7 !important;
}

.tr-filter__pencil {
    opacity: .3;
}

.tr-filter__pencil:hover {
    opacity: 1;
}
  
